import {SAVE_COLOR} from '../type';
import {DELETE_COLOR} from '../type';

const initialState = {
    data:[],
    name:''
}

export default function(state=initialState,action) {
    switch (action.type) {
        case SAVE_COLOR:

        return {
                ...state,
                data:action.payload

            }
        case DELETE_COLOR:
        return {
            ...state,
            data:action.payload
        }
        default:
            return state;
    }
}
